import "chart.js/auto";
import { Bar } from "react-chartjs-2";

class BarChart extends Component {
  constructor() {
    super(props);
    this.state = {
      data: {
        labels: [
          "NumberOfBedrooms",
          "NumberOfBathrooms",
          "TaxAmount",
          "Area",
          "YearBuilt",
        ],
        datasets: [
          {
            label: "User Input",
            data: [1, 2, 3, 4, 5],
            backgroundColor: ["red", "yellow", "blue", "pink", "green"],
          },
        ],
      },
    };
  }

  render() {
    return <Bar data={this.state.data} options={{}} />;
  }
}

export default BarChart;
